import { Link, useParams } from "react-router-dom";

const Baby_sitter=()=>{
    var permession=window.sessionStorage.getItem('permession')
    var {page}=useParams()
    return(
        <div className="babysitter">
            <div className="babysitter_div_top">
                <Link to={`/backend/${permession}/${page}/`}></Link>
            </div>
        </div>
    )
}
export default Baby_sitter;
